
// Using demo at: https://cs.stanford.edu/people/karpathy/convnetjs/demo/rldemo.html
let num_inputs = 11;
let num_actions = 6;
let temporal_window = 10;
let network_size = num_inputs*temporal_window + num_actions*temporal_window + num_inputs;

var layer_defs = [];
layer_defs.push({type:'input', out_sx:1, out_sy:1, out_depth:network_size});
layer_defs.push({type:'fc', num_neurons: 50, activation:'relu'});
layer_defs.push({type:'fc', num_neurons: 50, activation:'relu'});
layer_defs.push({type:'regression', num_neurons:num_actions});

// options for the Temporal Difference learner that trains the above net
// by backpropping the temporal difference learning rule.
var tdtrainer_options = {learning_rate:0.001, momentum:0.0, batch_size:64, l2_decay:0.01};

var opt = {};
opt.temporal_window = temporal_window;
opt.experience_size = 30000;
opt.start_learn_threshold = 1000;
opt.gamma = 0.7;
opt.learning_steps_total = 200000;
opt.learning_steps_burnin = 3000;
opt.epsilon_min = 0.05;
opt.epsilon_test_time = 0.05;
opt.tdtrainer_options = tdtrainer_options;
// opt.hidden_layer_sizes = [20,20];
opt.layer_defs = layer_defs;

let agents = [
  {
    brain: new deepqlearn.Brain(num_inputs, num_actions, opt),
    body: bot,
    enemy: protagonist
  },
  {
    brain: new deepqlearn.Brain(num_inputs, num_actions, opt),
    body: protagonist,
    enemy: bot
  }
];

let trainingData = [];

function botBrainCycle() {
  agents.forEach((agent) => {

    const currentMoment = snapMoment(agent.body, protagonist);
    const output = agent.brain.forward(currentMoment);

    const action = {
      0: {
        walkingDirection: 1,
        jumping: false
      },
      1: {
        walkingDirection: 0,
        jumping: false
      },
      2: {
        walkingDirection: -1,
        jumping: false
      },
      3: {
        walkingDirection: 1,
        jumping: true
      },
      4: {
        walkingDirection: 0,
        jumping: true
      },
      5: {
        walkingDirection: -1,
        jumping: true
      },
    };

    if (action[output]['jumping']) {
      agent.body.kineticState.jumping = true;
      agent.body.kineticState.freefall = true;
    } else {
      agent.body.kineticState.jumping = false;
    }
    agent.body.walkingDirection = action[output]['walkingDirection'];

    // if (action[output]['walkingDirection'] < 0.33) { agent.body.walkingDirection = -1; }
    // if (action[output]['walkingDirection'] >= 0.33 && output['walkingDirection'] < 0.66) { agent.body.walkingDirection = 0; }
    // if (output['walkingDirection'] >= 0.66) { agent.body.walkingDirection = 1; }
  });
}

function agentResponsibleFor(obj) {
  return agents.find((agent) => {
    return agent['body']['display']['color'] == obj['display']['color'];
  });
}

function rewardAgentsFor(obj, reward) {
  const responsibleAgents = agentResponsibleFor(obj);
  if (!responsibleAgents) { return; }
  if (responsibleAgents.body.display.color == 'blue') { return; } // one of them doesn't learn
  responsibleAgents.brain.backward(reward);
}

function savenet() {
  const j = agents[0].brain.value_net.toJSON();
  const t = JSON.stringify(j);
  const textArea = document.querySelector('#net-json');
  textArea.value = t;
  textArea
}

function loadnet(t) {
  var j = JSON.parse(t);
  agents[0].brain.value_net.fromJSON(j);
}

